/* eslint-disable no-dupe-keys */
/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { useState, useEffect } from "react";

import Slider from "react-slick";

const Currency = (props) => {
  const settings = {
    infinite: false,
    speed: 500,
    slidesToScroll: 7,
    slidesToShow: 4,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 3,
          slidesToScroll: 1,
          autoplay: false,
          swipeToSlide: true,
          nextArrow: false,
          prevArrow: false,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
          initialSlide: 2,
          autoplay: false,
          swipeToSlide: true,
          nextArrow: false,
          prevArrow: false,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          autoplay: false,
          swipeToSlide: true,
          nextArrow: false,
          prevArrow: false,
        },
      },
    ],
  };

  return (
    <Slider {...settings}>
      <div className="mt-3">
        <h6 className=" fw-bold">Khoảng giá </h6>
        <div className=" currentcy ">
          <button href="" className="fw-bold">
            Trên 50 triệu
          </button>
        </div>
      </div>
    </Slider>
  );
};

export default Currency;
